import { createRouter, createWebHistory } from 'vue-router';

const routes = [
    {
        path: '/',
        name: 'Home',
        component: () => import('@/pages/HomePage.vue'),
    },
    {
        path: '/application-form',
        name: 'ApplicationForm',
        component: () => import('@/pages/ApplicationFormPage.vue'),
    },
    {
        path: '/apply-now',
        name: 'ApplyNow',
        component: () => import('@/pages/ApplyNowPage.vue'),
    },
    {
        path: '/cost-breakdown',
        name: 'CostBreakdown',
        component: () => import('@/pages/CostBreakdownPage.vue'),
    },
    {
        path: '/orders-list',
        name: 'OrdersList',
        component: () => import('@/pages/OrdersListPage.vue'),
    },
    {
        path: '/payment',
        name: 'Payment',
        component: () => import('@/pages/PaymentPage.vue'),
    },
    {
        path: '/profile',
        name: 'Profile',
        component: () => import('@/pages/ProfilePage.vue'),
        meta: { requiresAuth: true }, // Optional meta field example
    },
    {
        path: '/reports',
        name: 'Reports',
        component: () => import('@/pages/ReportPage.vue'),
    },
    {
        path: '/track-visa',
        name: 'TrackVisa',
        component: () => import('@/pages/TrackVisaPage.vue'),
    },
    // 404 Not Found route
    {
        path: '/:pathMatch(.*)*',
        name: 'NotFound',
        component: () => import('@/pages/NotFoundPage.vue'),
    },
];

const router = createRouter({
    history: createWebHistory(),
    routes,
});

export default router;
